import React, { useState } from 'react';
import { Modal, Button } from 'react-bootstrap';

function CustomModal({ show, onClose, onSelectChoice }) {
  const [selectedChoice, setSelectedChoice] = useState('');

  const handleButtonClick = (choice) => {
    setSelectedChoice(choice);
  };

  const handleSubmit = () => {
    onSelectChoice(selectedChoice);
    setSelectedChoice('');
    onClose();
  };

  return (
    <Modal show={show} onHide={onClose}>
      <Modal.Header closeButton>
        <Modal.Title>Make a choice</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <p>Ld4JC는 Exchange를 하기 위해 Ambassador를 가지고 있다고 주장한다.</p>
        <div>
          <Button variant="primary" onClick={() => handleButtonClick('Challenge')}>
            Challenge
          </Button>{' '}
          <Button variant="secondary" onClick={() => handleButtonClick('Pass')}>
            Pass
          </Button>
        </div>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={onClose}>
          Close
        </Button>
        <Button variant="primary" onClick={handleSubmit}>
          Submit
        </Button>
      </Modal.Footer>
    </Modal>
  );
}


export default CustomModal;
